import React from 'react';
import logo from './img/logo.png';
import './About.css';
import sr from './ScrollReveal'

export class About extends React.Component {

    componentDidMount = () => {
        const config = {
          origin: 'right',
          duration: 500,
          delay: 100,
          distance: '50px',
          scale: 1,
          easing: 'ease',
        }
        sr.reveal(this.refs.i, config)
    }

    render(){
        return (
            <div>
                <header>
                    <a id="logo"><img class="clickable" style={{opacity: 1}} src={logo}/></a>
                    <nav>
                    <a class="selected clickable">About</a>
                    <a class="unselected clickable" href="">Portfolio</a>
                    </nav>
                </header>
            </div>
        );
    }
}
export default About;
